import './App.css';
import Image from './Image';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={'https://cdn.pixabay.com/photo/2017/02/20/18/03/cat-2083492_1280.jpg'} className="App-logo" alt="Cute cat staring" />
      </header>
    </div>
  );
}

export default App;
